        <td id="LC425" class="blob-code blob-code-inner js-file-line">alphamap_pars_fragment<span class="pl-k">:</span><span class="pl-s"><span class="pl-pds">&quot;</span>#ifdef USE_ALPHAMAP<span class="pl-cce">\n\t</span>uniform sampler2D alphaMap;<span class="pl-cce">\n</span>#endif<span class="pl-pds">&quot;</span></span>,alphatest_fragment<span class="pl-k">:</span><span class="pl-s"><span class="pl-pds">&quot;</span>#ifdef ALPHATEST<span class="pl-cce">\n\t</span>if ( diffuseColor.a &lt; ALPHATEST ) discard;<span class="pl-cce">\n</span>#endif<span class="pl-pds">&quot;</span></span>,aomap_fragment<span class="pl-k">:</span><span class="pl-s"><span class="pl-pds">&quot;</span>#ifdef USE_AOMAP<span class="pl-cce">\n\t</span>float ambientOcclusion = ( texture2D( aoMap, vUv2 ).r - 1.0 ) * aoMapIntensity + 1.0;<span class="pl-cce">\n\t</span>reflectedLight.indirectDiffuse *= ambientOcclusion;<span class="pl-cce">\n\t</span>#if defined( USE_ENVMAP ) &amp;&amp; defined( PHYSICAL )<span class="pl-cce">\n\t\t</span>float dotNV = saturate( dot( geometry.normal, geometry.viewDir ) );<span class="pl-cce">\n\t\t</span>reflectedLight.indirectSpecular *= computeSpecularOcclusion( dotNV, ambientOcclusion, material.specularRoughness );<span class="pl-cce">\n\t</span>#endif<span class="pl-cce">\n</span>#endif<span class="pl-pds">&quot;</span></span>,</td>
